import React from "react";
import "./ArtistCard.css";

function ArtistCard({ Artist }) {
  const pfp_image = Artist.pfp_image;
  const cover_image = Artist.cover_image;
  const artist_name = Artist.artist_name;
  const artist_followers = Artist.artist_followers;
  const artist_bio = Artist.artist_bio;

  return (
    <div>
      <div className="container padding">
        <div className="row">
          <div className="col">
            <div className="card">
              <img
                className="card-img-top"
                src={"https://i.imgur.com/K7A78We.jpg"}
                alt="Card image cap"
              />
              <div className="card-body little-profile text-center">
                <div className="pro-img">
                  <img className="link-profile" src={pfp_image} alt="user" />
                </div>
                <h3 className="m-b-0 btn link-profile">Brad Macullam</h3>
                <p>Web Designer &amp; Developer</p>{" "}
                <a
                  href="javascript:void(0)"
                  className="m-t-10 waves-effect waves-dark btn btn-primary btn-md btn-rounded"
                  data-abc="true"
                >
                  Follow
                </a>
                <div className="row text-center m-t-20 d-flex justify-content-center">
                  <div className="col-lg-4 col-md-4 m-t-20">
                    <h3 className="m-b-0 font-light">434K</h3>
                    <small>Followers</small>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ArtistCard;
